import React, { Component } from 'react'

export default class ShowAllButton extends Component {
    render() {
        return (
            <div>
                    <div className='mt-5 text-center '>
                            <button className='btn btn-warning text-white p-2'>Show All</button>
                    </div>
                    
            </div>
        )
    }
}
